import React from 'react';

function InfoTooltip(props) {
    return (
        <div className="popup popup_opened info-tooltip">
            <div className="popup__container info-tooltip__container">
                <button type="button" className="popup__close-button"></button>
                <img className="info-tooltip__picture" src={`./images/card-image.png`}></img>
                <h2 className="popup__title info-tooltip__title">
                    Вы успешно зарегистрировались!
                </h2>
            </div>
        </div>
    )
};

export default InfoTooltip;
